function Header() {
  return (
    <header>
      <div>
        <a href="#">Home</a>
      </div>
      <div>
        <a href="#">About</a>
      </div>
      <div>
        <a href="#">Contact</a>
      </div>
    </header>
  );
}

export default Header;
